#!/bin/sh
# download.sh: Download geomagnetic data from Edinburgh GIN
#
# This shell script is designed to download geomagnetic data
# from the Edinburgh INTERMAGNET Geomagnetic Information Node.
# To use the script, follow these steps:
#
# 1.) Create a new directory.
# 2.) Move to the new directory and copy the script there.
# 3.) Execute the script by typing './download.sh'.
#
# The script keeps track of its progress through the list of files
# to download. If it fails at any time, you can restart it and it will
# resume at the point where it failed.
#
# This software uses public domain URL downloading tools to retrieve
# from the GIN. At least one of the downloading tools must already be
# loaded on your computer. For further information on these tools
# see the web sites listed below:
#
#    Curl: http://curl.haxx.se/
#    Wget: http://www.gnu.org/software/wget/
#
#
# Configurable parameters - these variables control use of proxy
# servers at the users site - there's also an option to use
# authentication - change them as required (though the
# defaults should work OK)
gin_username=""
gin_password=""
proxy_username=
proxy_address=
#
#
#----------------------------------------------------------------------
# upd_op_co:         Increment and serialize the operation count
# Input parameters:  $gmcount the current operation number
# Output parameters: $gmcount is incremented (and written to disk)
upd_op_co ()
{
  gmcount=`expr $gmcount + 1`
  echo $gmcount > counter.dat
}

#----------------------------------------------------------------------
# safemd:            Safely create a dir (no error if it already exists)
# Input parameters:  $1 the directory to create
#                    $2 the operation number for this call
#                    $gmcount the current operation number
# Output parameters: $gmcount is incremented
safemd ()
{
  if [ $2 -ge $gmcount ] ; then
    if [ $2 -eq 0 ] ; then
      echo Creating directories...
    fi
    if [ ! -d $1 ] ; then
      mkdir -p $1
      if [ $? -ne 0 ] ; then
        echo "Error: unable to create directory: $1"
        exit 1
      fi
    fi
    upd_op_co
  fi
}

#----------------------------------------------------------------------
# getfile:           Download a file from a web server
# Input parameters:  $1 URL to download from
#                    $2 local file to download to
#                    $3 number of retries to do
#                    $4 the operation number for this call
#                    $gmtool name of the tool to use
#                    $gmtoolopts options for the tool to use
#                    $gmcount the current operation number
#                    $nFolders the number of folders to create
#                    $nDownloads the number of files to download
#                    $http_proxy proxy options for wget
# Output parameters: $gmcount is incremented
getfile ()
{
  if [ $4 -ge $gmcount ] ; then
    # tell the user what's going on
    percent=`expr \( \( $4 - $nFolders \) \* 100 \) / $nDownloads`
    echo "${percent}% - downloading file: $2"
    
    # remove any existing file
    rm -f "$2"
    
    case "$gmtool" in
    curl)
      curl $gmtoolopts -s --retry "$3" "$1" -o "$2"
      if [ $? -ne 0 ] ; then
        echo "Error: curl cannot download $2"
        exit 1
      fi
      ;;
    wget)
      wget $gmtoolopts -q -t "$3" -O "$2" "$1"
      if [ $? -ne 0 ] ; then
        echo "Error: wget cannot download $2"
        exit 1
      fi
      ;;
    *)
      echo "Error: unknown download tool: $gmtool"
      exit 1
      ;;
    esac
    
    if [ -r "$2" ] ; then
      df_file_exists=1
    else
      df_file_exists=0
    fi
    
    # rename IAGA-2002 files
    if [ $df_file_exists -ne 0 ] ; then
      dt=`grep -i 'Data Type' $2 | awk '{print $3}' | tr '[A-Z]' '[a-z]'`
      p1=`echo "$2" | awk '{print substr($0,1,length($0)-7);}'`
      p2=`echo "$2" | awk '{print substr($0,length($0)-6,7);}'`
      case "$dt" in
        definitive)
          mv "$2" "$p1"d"$p2"
          ;;
        quasi-definitive)
          mv "$2" "$p1"q"$p2"
          ;;
        provisional)
          mv "$2" "$p1"p"$p2"
          ;;
        variation)
          mv "$2" "$p1"v"$p2"
          ;;
      esac
    fi
    
    # tidy up
    unset percent
    unset df_file_exists
    upd_op_co
  fi
}

# check a download tool is available and that it supports https, then set gmtool
# to the tool name and set gmtoolopts to the options that the tool will use
which wget >/dev/null 2>&1
if [ $? -eq 0 ] ; then
  wget --version | grep '+https' >/dev/null 2>&1
  if [ $? -eq 0 ] ; then
    gmtool=wget
    if [ -n "$gin_username" ] ; then
      gmtoolopts="--http-user=$gin_username --http-password=$gin_password"
    fi
  fi
fi
which curl >/dev/null 2>&1
if [ $? -eq 0 ] ; then
  curl --version | grep 'https' >/dev/null 2>&1
  if [ $? -eq 0 ] ; then
    gmtool=curl
    gmtoolopts="-k"
    if [ -n "$gin_username" ] ; then
      gmtoolopts="$gmtoolopts --basic -u $gin_username:$gin_password"
    fi
  fi
fi
if [ -z "$gmtool" ] ; then
  echo "Error: Unable to find URL download software (curl or wget) that supports https"
  exit 1
fi

# set proxy options - use http_proxy environment for wget,
# for curl add to gmtoolopts
if [ -z "$proxy_address" ] ; then
  if [ "$gmtool" != "curl" ] ; then
    http_proxy=""
  fi
elif [ -z "$proxy_username" ] ; then
  if [ "$gmtool" != "curl" ] ; then
    http_proxy=http://"$proxy_address"/
  else
    gmtoolopts="$gmtoolopts -x $proxy_address"
  fi
else
  if [ "$gmtool" != "curl" ] ; then
    http_proxy=http://"$proxy_username"@"$proxy_address"/
  else
    gmtoolopts="$gmtoolopts -x $proxy_address -U $proxy_username"
  fi
fi
export http_proxy

# are we restarting a failed operation or starting from new
if [ -r counter.dat ] ; then
  echo "Information: resuming download after previous failure"
  gmcount=`cat counter.dat`
else
  gmcount=0
fi
